<BR>■ガラス系繊維とフッ素系ポリマーの融合により、ガラス系繊維が透明膜を形成し塗装本来の色を引き出しフッ素系ポリマーが雨や汚れを弾いてブロック。そのシールド効果は弊社降雨環境試験において年間平均降雨量換算で6ヶ月以上の持続性を実証しました。また、ガラス系繊維によるレベリング効果によって自然にコーティング膜厚が均一になるので、従来プロの施工法とされていたシーラント施工が誰でも液体ワックスと変わらない手軽さで出来るようになりました。塗装面の長期間の保護、撥水性を求める方に最適です。塗り込み用パッドにもこだわり、愛車の塗装を傷つけないために「3層構造パッド」を付属。塗装に直接触れる接触面には耐久性に優れ傷が付きにくい高密度圧縮素材、中間層にダンパー素材を5mm幅で配置し塗布面にかかる圧力を軽減、グリップ部には持ちやすい堅めの低発泡素材を使用しました。<FONT COLOR="Blue"></FONT><BR><BR><FONT COLOR="Green">送料は、佐川急便 5kg以下(関東の場合600円)です。</FONT><DIV ALIGN=CENTER>

